import { useDispatch, useSelector } from 'react-redux';
import React from 'react';
import { filterTemperaments } from '../actions'




function Buscar() {
    const dispatch = useDispatch()
    const temperamentos = useSelector((state) => state.temperament);

    //const [temperamentSelected, setTemperamentSelected] = useState("")


    const handleFilterTemp = (e) => {
        e.preventDefault();
        dispatch(filterTemperaments(e.target.value))
    }


    return (

        <div>
            <p>Filtrar por temperamento:</p>
            <select onChange={handleFilterTemp()} >
                <option value={''} >Seleccionar temperamento</option>
                {temperamentos.map((el) => (
                    <option value={el.name}>{el.name}</option>
                ))}
            </select>

        </div>

    )
}



export default Buscar;
